.conflict-resolved {
  background: rgba(255, 255, 255, 0.07);
}
.conflict-ours {
  background: rgba(139, 195, 74, 0.4);
}
.conflict-ours.cursor-line {
  background: rgba(139, 195, 74, 0.3);
}
.conflict-theirs {
  background: rgba(100, 181, 246, 0.4);
}
.conflict-theirs.cursor-line {
  background: rgba(100, 181, 246, 0.3);
}
.conflict-base {
  background: rgba(255, 202, 40, 0.4);
}
.conflict-base.cursor-line {
  background: rgba(255, 202, 40, 0.3);
}
.conflict-dirty {
  background: rgba(255, 241, 118, 0.4);
}
.conflict-dirty.cursor-line {
  background: rgba(255, 241, 118, 0.3);
}
